INSERT INTO `article` (`id`, `cid`, `type`, `title`, `content`, `timeline`, `img`) VALUES
(9, 1, 'image/jpeg', '超赞！让顶尖设计师告诉你10个色彩运用秘技', '<p>&ldquo;色彩，这是一种多么深刻而神秘的语言啊！&rdquo;的确，不同的色调能够调动不同的情绪和反映，能够影响用户对于品牌的感知。简单说来，色彩可以造就不同的设计。与此同时，研究表明，色彩能够强化品牌认知度（高达80%），加深用户印象，让品牌的设计和文本在同类中脱颖而出。</p>\r\n\r\n<p>幸运的是，我们的早已远离可选色彩匮乏的年代。技术的革新使得人们选取色彩不再受到天然色素的限制，合成色素与屏幕的出现让色彩和我们的生活越来越紧密，也使得选取和决定所需考虑的因素更加复杂。正是因为色彩的极大丰富，<a href="http://www.uisdc.com/tag/%e9%85%8d%e8%89%b2%e6%96%b9%e6%a1%88" target="_blank">配色方案</a>的选取的确越来越麻烦了。Colourlovers 社区已经为近800万种进行了命名，不过依然有超过1600种色彩在后面正排队等候。</p>\r\n\r\n<p>听起来是不是有点不堪重负的意思？别担心，听听来自Creative Market社区的顶级设计师的建议吧，他们会告诉你关于色彩选取的最佳技巧，让你也可以轻松挑选最佳的色彩组合。</p>\r\n\r\n<p>1、灵感捕捉</p>\r\n\r\n<p>来自Make Media 的 Callie Hegstrom 是一名才华横溢的设计师，对于获取灵感，她是这样建议的：&ldquo;我常常通过漂亮的照片来获取斑斓绚烂的<a href="http://www.uisdc.com/tag/%e9%85%8d%e8%89%b2%e6%96%b9%e6%a1%88" target="_blank">配色方案</a>，取色的时候直接通过PS或者AI就可以。图片是非常不错的<a href="http://www.uisdc.com/tag/%e9%85%8d%e8%89%b2" target="_blank">配色</a>来源，不过前提条件是你选取的图片一定要有足够的凝聚力。&rdquo;</p>\r\n\r\n<p><img src="http://image.uisdc.com/wp-content/uploads/2015/06/PHOTOCOPA-662x570.png" style="height:auto; margin:0px 0px 1.75em; width:662px" /><img src="http://image.uisdc.com/wp-content/uploads/2015/06/MAKEMEDIA-662x441.jpg" style="height:auto; margin:0px 0px 1.75em; width:662px" /></p>\r\n\r\n<p>所以，如果真的有色彩让你特别喜欢的照片，不妨直接借助它来制作一个好用而高效的<a href="http://www.uisdc.com/tag/%e9%85%8d%e8%89%b2%e6%96%b9%e6%a1%88" target="_blank">配色方案</a>。诸如 Photocopa 这样的工具会让这个过程更快捷，你所需要做的就是上传照片，然后探索可能的方案。</p>\r\n\r\n<p>2、用好你的色轮</p>\r\n\r\n<p>艺术家Marc Chagall 曾经说过一句被广泛引用的话：&ldquo;所有的色彩都是隔壁色彩的朋友，也是相反位置色彩的爱人。&rdquo;其实这句话说的就是色轮。</p>\r\n\r\n<p><img src="http://image.uisdc.com/wp-content/uploads/2015/06/COLORWHEEL.jpg" style="height:auto; margin:0px 0px 1.75em; width:529px" /></p>\r\n\r\n<p>来自温哥华Cultivated Mind 的设计师Cindy Kinash 曾说过：&ldquo;当使用水彩绘制花朵的时候，展现阴影最好的方式是使用色轮上相邻的色彩来绘制。&rdquo;</p>\r\n\r\n<p><img src="http://image.uisdc.com/wp-content/uploads/2015/06/CULTIVATEDMIND.jpg" style="height:auto; margin:0px 0px 1.75em; width:529px" /></p>\r\n\r\n<p>在Cindy的作品中，浅蓝和深蓝、紫色相邻，这一连串的色彩使用，渲染出了深度。色轮的使用技巧非常之广，色彩之间的关系是如此的清晰而富有规律，你可以轻松运用在不同的场合，创造出许多独特的组合。</p>\r\n\r\n<p>如果你对此并不了解，也不用担心，网上有大把的相关工具帮你搞定色轮的使用。</p>\r\n\r\n<p>3、向室内设计借灵感</p>\r\n\r\n<p>不同的设计领域，在处理色彩上有着相同的经验。在室内设计领域，设计师需要使用纹理、物体和色彩来调和空间。</p>\r\n\r\n<p>在这方面，来自MyCreativeLand 的英国设计师 Elena Genova 有过不错的建议：&ldquo;室内设计的许多设计规则运用在平面设计上非常靠谱，比如用色，60%的主色调、30%的辅助色、10%的强调色，这样的<a href="http://www.uisdc.com/tag/%e9%85%8d%e8%89%b2" target="_blank">配色</a>比例就非常不错。如果你需要引入第四种色彩，最好从辅助色当中分出一部分来。&rdquo;</p>\r\n\r\n<p><img src="http://image.uisdc.com/wp-content/uploads/2015/06/MYCREATIVELAND2.jpg" style="height:auto; margin:0px 0px 1.75em; width:529px" /></p>\r\n\r\n<p>其实许多领域当中知识和规律都是相通的，在不同的科学和艺术领域中借鉴规律并非是扯淡。所以，建筑学规律运用到平面设计中来，一点违和感都没有。</p>\r\n', '2015-06-10 06:52:28', );
INSERT INTO `article` (`id`, `cid`, `type`, `title`, `content`, `timeline`, `img`) VALUES
(10, 1, 'image/jpeg', '这才对！7个方法帮你精准判断一个LOGO的好坏', '<p>舞者们也许会问自己：&ldquo;迈克尔 &middot; 杰克逊会怎么看我的舞步呢？&rdquo;拳击手们会自问：&ldquo;拳王阿里会觉得我的右勾拳怎么样？&rdquo;那么作为设计师，我们一定会问自己&ldquo;Paul Rand会觉得我的Logo设计怎样呢？&rdquo; 今天这篇，绝对让你大有收获 &gt;&gt;&gt;</p>\r\n\r\n<p><img alt="" src="http://image.uisdc.com/wp-content/uploads/2015/06/blog-banner.jpg" style="height:auto" /></p>\r\n\r\n<p>相信我，只要通篇读完，你便知道Paul Rand对你的Logo是否看好了。</p>\r\n\r\n<p><strong>传奇人物</strong></p>\r\n\r\n<p><img alt="01" src="http://image.uisdc.com/wp-content/uploads/2015/06/0-ecsdxhw1ctry74pt.jpg" style="height:auto; width:690px" /></p>\r\n\r\n<p>Paul Rand是一名美国的艺术指导及平面设计师，其著名的Logo作品有IBM、UPS、Enron、Morningstar、Inc、Westinghouse、ABC和Steve Jobs的NeXT。</p>\r\n\r\n<p>Steve Jobs当初花费$100,000邀请Paul Rand设计NeXT电脑的Logo，即便这个做法并不合Jobs的心意，Rand仍坚持只提供一款方案。</p>\r\n\r\n<p>当Steve Jobs问他是否能多提供几款方案时，他的回答是，&ldquo;不。我会为你解决问题，而你会为这个解决方案付费。当然你并不非得接受这种方式，如果实在想多要几款方案，那就只能另请高明了。&rdquo;</p>\r\n\r\n<p>Rand最终提交了一份共100页的品牌细节手册，其中囊括了Logo倾斜的精确角度（28&deg;）以及公司的新名称NeXT。</p>\r\n\r\n<p>Paul Rand为测试这个Logo所定的基础性标准颠覆了全球的Logo设计界概念：</p>\r\n\r\n<p>一个Logo的作用在于便于识别，简洁即是达到此目标的方式&hellip;&hellip;它的效用取决于其独特性、可视性、适应性、可记忆性、普适性，以及能做到经典不过时。</p>\r\n\r\n<p>上文中对Paul-Rand 的7步测试法如何评定一个Logo作了介绍，以下我们来介绍这具体是哪7个步骤：</p>\r\n\r\n<ol>\r\n	<li>它是否具有独特性？</li>\r\n	<li>它是否具有可视性？</li>\r\n	<li>它是否具有适应性？</li>\r\n	<li>它是否容易记忆？</li>\r\n	<li>它是否具有普适性？</li>\r\n	<li>它是否经典不过时？</li>\r\n	<li>当你对这6题的答案均为肯定时，便是时候问这最后的问题了：它是否简洁？</li>\r\n</ol>\r\n\r\n<p>除最后的问题以外，每个问题的分值为1-10，最后一题为1-15。这个公式有助大家找到Logo的重点所在，得分在75分以上的为满意，60分以下可考虑弃用。</p>\r\n\r\n<p><strong>小白鼠</strong></p>\r\n\r\n<p>判断一个测试是否有效的最佳方式莫过于举例了，那么我们就拿微软搜索引擎Bing的上一版Logo来试验一下。</p>\r\n\r\n<p><img alt="02" src="http://image.uisdc.com/wp-content/uploads/2015/06/0-ibudkcht0cca0638.jpg" style="height:auto" /></p>\r\n\r\n<p>上图中的Bing Logo于2013年9月起被停用并进行改版，原因很明显，我们来用7步法评定一下就知道了。</p>\r\n\r\n<p><strong>1. 它是否具有独特性？</strong></p>\r\n\r\n<p>独特性指的是与众不同。它在众Logo中能够脱颖而出，不被混淆。</p>\r\n\r\n<p>在我们的案例中， Bing 的 Logo 使用了一款年轻大众化的蓝色，而80%的Logo均选用蓝色。字体为开阔宽广型&mdash;&mdash;对搜索引擎来说这的确较为适用，但却过于扁平单调，如果想要胜出竞争对手谷歌，这显然是不够的。</p>\r\n\r\n<p>由于Logo中不含任何辅助图形，那么字体所担任的角色就要承担很大的压力，因为所有品牌信息都只能靠它来传达。然而，字体设计却没有显示出任何独特之处。虽然宽型字体使用了许多留白空间，但是仍感觉所有的字母都挤在一起，尤其是字母&ldquo;i&rdquo;的周围。</p>\r\n\r\n<p>字母&ldquo;g&rdquo;转角曲线的断点显得较为突兀，感觉冰冷和且不完整。</p>\r\n\r\n<p>&ldquo;g&rdquo;右上侧的小耳朵如果更细一些，就会看起来像一名谢顶男士飘起的一撮头发，这不禁令我想到了年龄问题&hellip;&hellip;</p>\r\n\r\n<p><strong>3/10</strong></p>\r\n\r\n<p><strong>2. 它是否具有可视性？</strong></p>\r\n\r\n<p>可视性是指Logo是否容易被注意到或看见。这个Logo所占空间很大，所以具有较高可见度。然而，很多设计师在设计Logo时都从黑白稿开始，旨在使可视性不受颜色影响。当Bing的Logo转换成黑白模式时，&ldquo;i&rdquo;上的黄色圆点就几乎消失了&mdash;&mdash;而这个圆点恰恰代表了品牌的个性所在。因此，一定要确保你的Logo在黑白模式下也具有良好视觉效果。</p>\r\n\r\n<p><strong>6/10</strong></p>\r\n\r\n<p><strong>3. 它是否具有适应性？</strong></p>\r\n\r\n<p>适应性是指Logo可以在各类应用情况下都能有良好表现，如：T恤衫、杯子、线上媒介、卡车、路标等。</p>\r\n\r\n<p>在我们的案例中，Bing的Logo含有足够的留白空间，几乎令其在任何情况下都可被识别。但唯一的问题是它在正方形或其它细长型的版面中不太适用。Logo中的文字过分向横向延展，在如手机应用及浏览器地址栏小标志中就无法取得良好效果。也许单提取字母&ldquo;b&rdquo;不失为可行方案，然而如此一来，便失去了Logo的独特性，因为单单这个字母&ldquo;b&rdquo;显得过于平淡无奇了。</p>\r\n\r\n<p><strong>5/10</strong></p>\r\n\r\n<p><strong>4. 它是否容易记忆？</strong></p>\r\n\r\n<p>一个Logo的终极目标就是不被遗忘。如此一来，当别人需要你所提供的服务时，就会立刻想到你的Logo。大家可以通过词汇联想来对此进行测试。词汇联想是这样练习的，你听到或看见任何事物或图形时，第一个想到的词是什么。大家一起来对以下的Logo来进行词汇联想：</p>\r\n\r\n<p><img alt="03" src="http://image.uisdc.com/wp-content/uploads/2015/06/0-ueoeoo0ahftmaxzu.jpg" style="height:auto" /><img alt="04" src="http://image.uisdc.com/wp-content/uploads/2015/06/0-fn9dfetkmigfz4is.jpg" style="height:auto" /><img alt="05" src="http://image.uisdc.com/wp-content/uploads/2015/06/0-j_fuswni4df_khze.jpg" style="height:auto" /></p>\r\n\r\n<p>我得出的结果是这些：啤酒、薯片和汽车。这些Logo中有没有包含&ldquo;啤酒&rdquo;、&ldquo;薯片&rdquo;和&ldquo;汽车&rdquo;这些文字呢？没有，它们不需要。因为这些Logo具有很强的识别性和记忆度。</p>\r\n\r\n<p>在我们的案例中，Bing的Logo中并没有出现&ldquo;搜索引擎&rdquo;的字样，新版Logo中针对这一点的解决方案非常有趣，我们会在下文中看到。</p>\r\n\r\n<p>Bing的Logo过于扁平，并且缺乏情感，这些都很难令人们记住它。</p>\r\n\r\n<p><strong>2/10</strong></p>\r\n\r\n<p><strong>5. 它是否具有普适性？</strong></p>\r\n\r\n<p>具有普适性的Logo的意义在于，品牌所传达的意义对于各类人群来说都是一致的。这可能是Logo设计中最难的一部分了，因为每个人的想法都不同。那些出色的全球品牌是如何做到这一点的呢？</p>\r\n\r\n<p>谷歌使用了颜色。</p>\r\n\r\n<p><img alt="06" src="http://image.uisdc.com/wp-content/uploads/2015/06/0-hsr6gzzxalxj9kyb.jpg" style="height:auto" /></p>\r\n\r\n<p>苹果公司使用了全世界都常见的水果和中性配色。</p>\r\n\r\n<p><img alt="07" src="http://image.uisdc.com/wp-content/uploads/2015/06/0-jqk9huxi89qtsyct.jpg" style="height:auto" /></p>\r\n\r\n<p>注意：苹果公司的Logo甚至不需要任何文字就能够被识别，这在普适性上简直堪称典范。</p>\r\n\r\n<p>Bing作为一个搜索引擎，其Logo应该展示出力量和复杂性，但同时又不能破坏易用性的表达（应确保每位用户友好的使用体验）。这个设计的朴实外观传达了易用性和亲切度，但却完全没有表现出任何与强大搜索力和知识深度有关的信息。</p>\r\n\r\n<p><strong>4/10</strong></p>\r\n\r\n<p><strong>6. 它是否经典不过时？</strong></p>\r\n\r\n<p>要记住，设计一款不过时的Logo，首要原则就是拒绝使用&ldquo;最热门&rdquo;的颜色，&ldquo;最炫&rdquo;的字体或&rdquo;最酷&ldquo;的风格。时尚如风云变幻，然而太阳却照常升起，天空也总是不变的蓝色。找到设计中的核心要点，摒弃多余的修饰。极简主义的艺术精髓即是&mdash;&mdash;少即是多。</p>\r\n\r\n<p>Bing的旧版Logo在避免过多雕饰和短期流行上做得还是不错的，但是过圆的外观却在表达领先行业的概念上起了反作用。</p>\r\n\r\n<p><strong>6/10</strong></p>\r\n\r\n<p><strong>7. 关键一问：它是否简洁？</strong></p>\r\n\r\n<p>Paul Rand说过一个Logo即是极简主义的缩影。</p>\r\n\r\n<p>&ldquo;一个Logo若无简洁和自控力，便毫无存活的可能。&rdquo;</p>\r\n\r\n<p>Paul Rand Logo测试法的前6步有助提高Logo的独特性，持久度和记忆度等。这最后一步是为了摒除不必要的细节，打造出纯粹且有意义的成果。</p>\r\n\r\n<p>这里有两个实用标准可以帮助大家衡量Logo是否达到应有的简洁度：</p>\r\n\r\n<ol>\r\n	<li>把它缩得很小，再放得很大。一款优秀的Logo设计应该具有易读性，并且无论哪种尺寸都具美观性。</li>\r\n	<li>在十秒内用铅笔画出Logo。如果这点很容做到，那么你便拥有了一款足够简洁的Logo。</li>\r\n</ol>\r\n\r\n<p>简洁是之前六条标准的桂冠，它的分值为1-15，从中也能看出其重要性。一款与众不同、极具创意的Logo很有可能失分，因为它们常常以牺牲简洁度为代价。关于简洁的Logo，最好的例子就是Nike的那一勾了：</p>\r\n\r\n<p><img alt="08" src="http://image.uisdc.com/wp-content/uploads/2015/06/0-xsmy1a1zugys3ahn.jpg" style="height:auto" /></p>\r\n\r\n<p>这个市值$150亿的企业用这小小一勾表达了：胜利、运动鞋以及希腊女神。这个Logo被众人奉为经典。</p>\r\n\r\n<p>Bing的Logo在这点上效果并不理想。不过它虽然没有传达出引人注目抑或深刻的含义，但是却保有了简洁度。有一点值得注意：过度简洁可能造成欠考虑及枯燥的印象。</p>\r\n\r\n<p>要想在直观简洁与枯燥乏味的设计中寻得平衡，我们必须分析品牌故事，并进行反推。品牌的主要特点有哪些？它们的优势是什么？需要克服什么冲突？理想的结果应该是什么样子？整合这些想法，把它们图形化，然后再开始简化，直至其核心元素。</p>\r\n\r\n<p><strong>10/15</strong></p>\r\n\r\n<p><strong>总分</strong></p>\r\n\r\n<p>将Bing Logo的所有得分相加，合计为：</p>\r\n\r\n<ol>\r\n	<li>独特性 3</li>\r\n	<li>可视性 6</li>\r\n	<li>适应性 5</li>\r\n	<li>记忆度 2</li>\r\n	<li>普适性 4</li>\r\n	<li>经典度 6</li>\r\n	<li>简洁度 (总分为15分) 10<br />\r\n	总分：36</li>\r\n</ol>\r\n\r\n<p>36分的得分解释了微软为何发布了这个Logo&mdash;&mdash;因为作为一个Logo，它功能尚属合格，然而却无法发挥长期效用。</p>\r\n\r\n<p><strong>Bing的新版Logo</strong></p>\r\n\r\n<p>2013年9月，微软发布了Bing的新版Logo，我们可以发现巨大的改变。</p>\r\n\r\n<p><img alt="09" src="http://image.uisdc.com/wp-content/uploads/2015/06/0-mo-dlw1bbdc4jpt.jpg" style="height:auto" /></p>\r\n\r\n<p>Logo作了以下改动：</p>\r\n\r\n<ul>\r\n	<li>&ldquo;g&rdquo;的曲线变为了一个微笑（这跨越了所有文化障碍）。</li>\r\n	<li>新添加的图标强烈显眼，给文字留有呼吸空间。</li>\r\n	<li>设计中融入了细微变化（例如：&ldquo;b&rdquo;顶部的轻微斜度），传达了&ldquo;轻搜索&rdquo;的品牌故事。</li>\r\n</ul>\r\n\r\n<p>Paul Rand的Logo测试可用于任何Logo。我们在这里以Bing为例给大家作参考，现在该轮到你了。看看你的Logo得分是高还是低呢？</p>\r\n\r\n<p><strong>【LOGO设计经典好文】</strong></p>\r\n\r\n<blockquote>\r\n<p><strong>资深广告人帮你读懂甲方真正意图！</strong><br />\r\n<a href="http://www.uisdc.com/best-logo-design-guide" target="_blank">《设计师必读！如何从甲方抽象的概念里提炼LOGO创意》</a></p>\r\n\r\n<p><strong>LOGO再漂亮，还是不能触及的底线：</strong><br />\r\n<a href="http://www.uisdc.com/the-logo-design-of-the-taboo" target="_blank">《设计师必看！LOGO设计的忌讳有哪些？》</a></p>\r\n\r\n<p><strong>上中下三篇，今年最完整的LOGO设计教程！</strong><br />\r\n<a href="http://www.uisdc.com/2014-logo-design-guide" target="_blank">《超赞！2014 LOGO设计新手指南（上篇）》</a></p>\r\n</blockquote>\r\n\r\n<p><strong>原文地址：</strong><a href="https://medium.com/entrepreneur-s-handbook/the-7-step-paul-rand-logo-test-5c7b546af17b" target="_blank">medium</a><br />\r\n<strong>译者：</strong><a href="http://www.weibo.com/p/1005055033476848/follow?relate=same_follow&amp;from=page_100505_profile&amp;wvr=6&amp;mod=bothfollow" target="_blank">@doo-plus</a></p>\r\n', '2015-06-10 07:37:37', );
INSERT INTO `article` (`id`, `cid`, `type`, `title`, `content`, `timeline`, `img`) VALUES
(20, 1, 'image/jpeg', '速成技巧篇！一个月内如何学习才能应聘交互设计实习生？', '<p>编者按：今天这篇是实打实的&ldquo;交互设计速成法&rdquo;，虽然有很多技巧可以帮你迅速拿到Offer，但如作者@窒息红Leon&nbsp;所说，应试的做法是短期的，投机取巧从长远来看总归是害了自己 &gt;&gt;&gt;</p>\r\n\r\n<p>作者者的微信公众号：zhenlei_pd，推荐同学们关注呦。本文为译者授权优设发布，未经作者本人授权请勿转载，谢谢 ：）</p>\r\n\r\n<p>@窒息红Leon&nbsp;：我一直认为，求职是一件持续性的工作，就像学习一样。所以关于简历怎么写、短时间内怎么进入 BAT 等问题对于过来人看真的不是很必要。有一些实话说出来大家不爱听，但是却是事实，不幸的是大部分学生喜欢听一些「然并卵」的话。</p>\r\n\r\n<p>比如之前在一个沙龙上，学生问拿到腾讯 Offer 的学长，也马上要找工作了，没什么相关项目实习经历和储备，技术也做不好，该怎么准备成为一个产品经理？学长说，要多了解行业动态，多下一些热门的产品把玩，多看 36kr 或者知乎，然后也可以试试做一些小项目&mdash;&mdash;提问题的同学心满意足地表示感谢。</p>\r\n\r\n<p>这个回答有用吗？我说一点用也没有，都是废话，甚至我还听说有人从零基础到拿到产品经理实习 Offer 只要三个小时（培训押题性质）。我也被问过类似的问题，质疑了同学选择产品经理的动机和契合度时，还被责怪不尊重他的选择，非常让人无奈。</p>\r\n\r\n<p>平时的一点一滴，画的每一张图、做的每一个项目、写的每一篇文章、看的每一本书、拍的每一张照片、走过的每一个地方，都是你的履历。而简历，只不过是把这个过程中符合岗位要求的部分拿出来整理一下罢了。而不是真的要把找工作这么重要的事搞得和临考突击一样，即便考过了，也只能全忘。</p>\r\n\r\n<p>你真的喜欢互联网吗？你的什么事例可以证明这一点？从中你培养了什么有用的能力？</p>\r\n\r\n<p>这是值得思考的三个问题。</p>\r\n\r\n<p>如果还是想要临时抱佛脚，再看看下面的文章吧。</p>\r\n\r\n<p><img alt="接地气的网站" src="http://image.uisdc.com/wp-content/uploads/2014/03/website-design-workspaces.jpg" style="height:auto; margin:0px 0px 1.75em; width:690px" /></p>\r\n\r\n<p>我自己从零基础到拿到一份交互实习的 offer 前后花了近两年时间，所以看到想一个月速成说没有不爽是假的，不过呢，对于学生来说，确实经常需要用到这样一些「应试」的方法，短期内拿到一块敲门砖，进入岗位之后作为小白再重新接受洗礼吧。</p>\r\n\r\n<p>所以问题就变成了：考试前三天，上课基本没听过，作业全是抄的，书和新的一样，怎么突击考试？</p>\r\n\r\n<p>让来我给你一点实用的意见，也许只能帮你一个月入门，而不是靠这些拿到 Offer。</p>\r\n\r\n<p>我看了一下其他回答，他们说的书你大部分都不用看。不用看不是说这些书不好，是书海战术和你一个月速成的目标不符。马上就要考试了，还一个概念一个概念去复习是不可能来得及的，更别说去借一堆参考书来看，一来你没时间仔细阅读，走马观花只会让你发现不懂的地方越来越多，然后失去信心；二来参考书里的题千变万化，考试又不一定考，所花费的时间完全没有针对性。那怎么办&mdash;&mdash;做原题。</p>\r\n\r\n<p>明确一下你想投递的<a href="http://www.uisdc.com/tag/%e4%ba%a4%e4%ba%92%e8%ae%be%e8%ae%a1" target="_blank">交互设计</a>方向，短时间内大而全是不可能的，小而美是我们的目标。如果你想去大的平台，一定要选清楚部门，最好是结合自己此前的经历和兴趣：喜欢逛什么网站，经常用什么产品，参加过什么领域的团队等。打个比方，我以前开过快递店，也送过外卖，对物流这块比较熟悉，也比较感兴趣，那就选 O2O 方向，有菜鸟、美团、饿了么等；我以前喜欢黑莓做过小型 BBS，有社区设计和运营经验，就可以试试人人网、知乎、豆瓣等；我还喜欢唱歌，搞过乐队，那就可以针对网易云音乐，QQ 音乐之类&hellip;&hellip;</p>\r\n\r\n<p>选定方向以后，去把网上能找到的产品分析、体验报告、测评都翻出来，仔细看一遍，这就是你的原题。然后抓住其中的一个方向（比如网易云音乐），深度体验这个 App 的每一个页面和每一个功能，在纸上画出逻辑功能图，看看有没有突破口。再结合自己的使用经验和身边朋友的反馈，提出几个设计改进意见。你还会 PS 呢，就算不会，在纸上画草图也可以，把这个改进方案呈现出来，直接投递给目标产品的产品经理或负责人。</p>\r\n\r\n<p>我朋友此前在机场地面工作，卖过机票也接触过代理，后来想去互联网，就投了阿里的「去啊」。去啊的业务很多，朋友就只选了机票业务，提出了很多改进意见，比如下面这样：</p>\r\n\r\n<p><img alt="" src="http://image.uisdc.com/wp-content/uploads/2015/06/fadf81025c55ef73e58f777bc50ae470_b.jpg" style="height:auto; width:690px" />&nbsp;<img alt="" src="http://image.uisdc.com/wp-content/uploads/2015/06/beb08e83a6569786e68c8e659a0df7dc_b.jpg" style="height:auto; width:690px" /></p>\r\n\r\n<p>最后面试通过，要不是阿里因为上市前夕冻结了 HC，肯定也能成功。</p>\r\n\r\n<p>甚至如果你对逻辑流程很擅长，觉得目标产品的注册登录流程有问题，也可以就这个小方面做一些改进意见，画个流程图总会吧：</p>\r\n\r\n<p><img alt="" src="http://image.uisdc.com/wp-content/uploads/2015/06/9724cae847c0ec22ab54ed193601bafe_b.jpg" style="height:auto; width:690px" /></p>\r\n\r\n<p>再多说一句，千万别写那些笼统的体验报告，面试官不需要你提醒他产品有多少个页面，有什么功能，做专业的事而不要做机械的工作。</p>\r\n\r\n<p>对了，关于读书，我有更好的建议。</p>\r\n\r\n<p>《破茧成蝶》是不错的，要看的话可以只看这一本。别的都别看了，尤其《About Face 3》，我看了两遍都云里雾里，不信你一个月能看出什么花样来。</p>\r\n', '2015-06-14 09:07:33', );
INSERT INTO `article` (`id`, `cid`, `type`, `title`, `content`, `timeline`, `img`) VALUES
(22, 1, 'image/jpeg', '超实用！3个方法教你设计顶尖电商BANNER', '<p>编者按：Banner的重要性无需赘言，今天这篇文章从走心的文案、不同的构图方法和如何字体选择3个方面，聊聊如何迅速提升Banner的质量 &gt;&gt;&gt;</p>\r\n\r\n<p>当用户访问电商网站的时候，第一屏的信息展示是非常重要的，很大程度上影响了用户是否决定停留，然而光靠文字大面积的堆积，很难直观而迅速的告诉用户来到这里会得到什么有用的信息，因此网页Banner设计在这里起到了至关重要的展示作用，特别是对于首页Banner，有效的信息传达可以快速提高页面转化率。那么竹子来教你如何设计一个好的电商Banner。</p>\r\n\r\n<p>作者：风尾竹，公众账号：liaosheji2010。</p>\r\n\r\n<p>本文为作者授权优设发布，未经作者本人授权请勿转载，谢谢 ：）</p>\r\n\r\n<p><strong>一、走心的文案</strong></p>\r\n\r\n<p>好的标题能够吸引你的注意，而糟糕的标题，让人看都不想看，扫一眼便略过去了。所以做好Banner第一件事情，就是需要设计走心的文案。所谓走心，就是触动你的心灵，或者说让你感兴趣，激发你的点击欲望。</p>\r\n\r\n<p><img alt="1ys20150614" src="http://image.uisdc.com/wp-content/uploads/2015/06/1ys20150614.jpg" style="height:auto; margin:0px 0px 1.75em; width:600px" /></p>\r\n\r\n<p>我们时常会看见这样的广告：文案内容直接罗列了公司经营产品或业务，抑或是像说明书一样详尽介绍产品或服务的主要功能。从广告主的角度来看这是合理的，用户需要知道我们产品有这些特点，这样我的的产品和服务才能被记住。但事实往往是：这些平淡无趣的广告，除了广告主自己以外，很难有用户真的愿意关注它。</p>\r\n\r\n<p>那我们来分析下写文案人的心理：B点明确想让用户买我的记录仪。那么A点是用户想买记录仪不知道哪家好，我的记录仪有这么多功能，那么用户一定需要这个记录仪。</p>\r\n\r\n<p><img alt="2ys20150614" src="http://image.uisdc.com/wp-content/uploads/2015/06/2ys20150614.jpg" style="height:auto; margin:0px 0px 1.75em; width:600px" /></p>\r\n\r\n<p>但用户真正的A点可能并不是&ldquo;想买记录仪，不知道哪家记录仪比较好&rdquo;，而是我为什么需要行车记录仪?所以对于这样的用户A点，可能更合适的文案思路是告诉用户：</p>\r\n\r\n<p><img alt="3ys20150614" src="http://image.uisdc.com/wp-content/uploads/2015/06/3ys20150614.jpg" style="height:auto; margin:0px 0px 1.75em; width:600px" /></p>\r\n\r\n<p>当然用户绝对不会因为你写了几句话，就买下产品，还会考虑价格品质等等因素。不过我们这个Banner的使命就是吸引用户点击，提高页面转化率。用户感兴趣点了，你就成功了。</p>\r\n\r\n<p>一篇帮你快速学会写文案的经典好文：<a href="http://www.uisdc.com/7-top-copywriter-skills" target="_blank">《年度最佳教程！7招教你写出互联网顶尖文案！</a>》</p>\r\n\r\n<p><strong>二、均衡的构图</strong></p>\r\n\r\n<p>构图其实说白了就是经营画面，进行布局，如何在你构图的引导下吸引用户点击，产生欲望，了解内容，如果都能达到，那说明你的构图成功了。</p>\r\n\r\n<p><img alt="4ys20150614" src="http://image.uisdc.com/wp-content/uploads/2015/06/4ys20150614.jpg" style="height:auto; margin:0px 0px 1.75em; width:600px" /></p>\r\n\r\n<p>第一眼睛看到这个banner这个图完全抓不到重点啊，满眼的小文字，另外加上两个傲娇的大叔。完全不知道想表达什么。等等，下面四个小方块是什么鬼？构图感觉实在糟糕。那么下面来说下banner的构图，构图规则分以下几种：</p>\r\n\r\n<p><strong>1、左右式构图</strong></p>\r\n\r\n<p>最常见的构图方式，分别把主题元素和主标题左右摆放。</p>\r\n\r\n<p><img alt="5ys20150614" src="http://image.uisdc.com/wp-content/uploads/2015/06/5ys20150614.jpg" style="height:auto; margin:0px 0px 1.75em; width:600px" /></p>\r\n\r\n<p><strong>2、居中辐射式构图</strong></p>\r\n\r\n<p>标题文字居中，分别把主题元素环绕在文字周围，用在着重强调标题的环境。</p>\r\n\r\n<p><img alt="6ys20150614" src="http://image.uisdc.com/wp-content/uploads/2015/06/6ys20150614.jpg" style="height:auto; margin:0px 0px 1.75em; width:600px" /></p>\r\n\r\n<p><strong>3、三角形构图</strong></p>\r\n\r\n<p>倒三角构图，标题突出，构图自然稳定，空间感强。</p>\r\n\r\n<p><img alt="7ys20150614" src="http://image.uisdc.com/wp-content/uploads/2015/06/7ys20150614.jpg" style="height:auto; margin:0px 0px 1.75em; width:600px" /></p>\r\n\r\n<p><strong>4、斜线构图</strong></p>\r\n\r\n<p>产品所占比重相对平衡，构图动感活泼稳定，运动感空间感强。此类构图适合科技、汽车、潮流题材，不过好像电商一般不卖汽车？</p>\r\n\r\n<p><img alt="8ys20150614" src="http://image.uisdc.com/wp-content/uploads/2015/06/8ys20150614.jpg" style="height:auto; margin:0px 0px 1.75em; width:600px" /></p>\r\n\r\n<p><strong>三、合适的字体</strong></p>\r\n\r\n<p><img alt="9ys20150614" src="http://image.uisdc.com/wp-content/uploads/2015/06/9ys20150614.jpg" style="height:auto; margin:0px 0px 1.75em; width:600px" /></p>\r\n\r\n<p>看到这个banner竹子总感觉好像那里不对，女性的特点是细致优雅，为什么字体如此粗壮了？和女性化妆品的气氛完成不符啊。每个字体好像人一样，都有自己的性格与气质。选择使用一款字体的时候，除了考虑它的易读性，更多考虑的是这款字体能否准确地传达出对产品独有的气质。下面竹子告诉你应该如何选择字体。</p>\r\n\r\n<p><strong>男性气质：方正粗谭黑、站酷高端黑、造字工房版黑、蒙纳超刚黑</strong></p>\r\n\r\n<p>黑体给人感觉粗壮紧凑，颇有力量感，可塑性很强。适用于各种大促类的电商广告。</p>\r\n\r\n<p><img alt="10ys20150614" src="http://image.uisdc.com/wp-content/uploads/2015/06/10ys20150614.jpg" style="height:auto; margin:0px 0px 1.75em; width:600px" /></p>\r\n\r\n<p><strong>文艺气质：方正大小标宋、方正静蕾体、方正清刻本悦宋、康熙字典体</strong></p>\r\n\r\n<p>宋体的衍生有很多，又长有扁，有胖有瘦。旅游类电商网站经常会用到此类字体。运用宋体进行排版处理，既显得清新又文艺。</p>\r\n\r\n<p><img alt="12ys20150614" src="http://image.uisdc.com/wp-content/uploads/2015/06/12ys20150614.jpg" style="height:auto; margin:0px 0px 1.75em; width:600px" /><img alt="11ys20150614" src="http://image.uisdc.com/wp-content/uploads/2015/06/11ys20150614.jpg" style="height:auto; margin:0px 0px 1.75em; width:600px" /></p>\r\n\r\n<p><strong>女性气质：方正兰亭超细黑、汉仪秀英体</strong></p>\r\n\r\n<p>字如其人，女性的特点是细致优雅、苗条细长；常被用作化妆品、女性杂志、艺术等女性主题领域。</p>\r\n\r\n<p><strong>文化气质：王羲之书法字体、颜真卿颜体</strong></p>\r\n\r\n<p>书法字体具有很强的设计感与艺术表现力，运用好的话往往是点睛之笔。各式各样的书法字体有着自己独特的细腻的特点，把握好这一点，既能增加文化内涵，也能衬托出产品的气质。</p>\r\n\r\n<p><img alt="13ys20150614" src="http://image.uisdc.com/wp-content/uploads/2015/06/13ys20150614.jpg" style="height:auto; margin:0px 0px 1.75em; width:600px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n', '2015-06-15 05:42:38', );

