(30, 4, '最低支持 Adobe CS 版本', 'CS 5.5', ''),
(33, 10, '基于 Bootstrap', '为什么这很重要? Bootstrap 是久经开发者无数次考验和信赖的工具. 它让我们想起了超人, 朋友你完全可以信任这个工具.', ''),
(34, 11, 'OOCSS方法', '基于对象的编码方法鼓励代码复用，快速创建和全效能的样式表.', ''),
(35, 11, ' \r\n兼容 Bootstrap 3', '现在胖子UI pro 兼容 Bootstrap 3.', ''),
(36, 11, '可配置的配色方案', '你可以改变任何或所有的颜色。胖子 UI拥有容易配置和匹配你的品牌的配色方案.', ''),
(37, 11, '安装方便', '只需要把胖子UI的配置文件链接进<head>标签里面即可.就是这样简单！', ''),
(38, 12, '图标 &符号', '胖子 UI Pro包括100 SVG图标和50标志性符号. 插图具有视觉冲击，可以让你的界面更容易被理解.', ''),
(39, 13, 'SVG图标<span class="newlabel">新</span>', '因为来自HTML，所以更容易改变大小和颜色. 无光栅图片从现在开始.', ''),
(40, 13, '矢量图标', '矢量图像很容易延伸到全彩色插图.', ''),
(41, 13, '原创图层', '所有的层都是原创的,而设计灵感来自大自然.', ''),
(42, 13, '符号', '用符号作为你的button,input以及header.也可以作为一个图标.', ''),
(43, 14, '颜色面板', '颜色面板非常方便,不仅仅因为可以可以很容易的改变UI元素，也可以很简单的对图标配色.', ''),
(44, 15, '颜色面板包括', '使用photoshop图像处理软件和基本的颜色配置文件轻松挑选和改变颜色.', ''),
(45, 16, '快速成型', '胖子UI是你项目开发时快捷和强有力的的工具,它适合于任何项目,因为它包含了最新的和现代的网络元素.', ''),
(46, 17, '网格对齐', '汲取Boostrap优秀经验，所有的元素都是12列网格对齐，大大简化了开发布局.', ''),
(47, 17, '设计 → 布局', '用photoshop图像处理软件快速设计出页面,使用胖子UI布局工具快速成型网站.', ''),
(48, 18, '响应式布局', '我们的布局工具兼容现在的各个平台,不需要额外的代码来兼容.', ''),
(49, 19, '赚取25%的佣金', '拥有博客的人，网站或社交媒体账户可以加入我们的会员计划，赚取25%的佣金由designmodo支付 .', ''),
(50, 19, '如何使用会员计划', '遵循这些指示，把广告放在你的博客包括关联文本链接，电子邮件，和在社交平台账号.', ''),
(51, 19, '拥有账号', '交流平台旨在让所有开发者交流本产品,我们会关注客户的每一个意见并进行分析反馈，更加完善胖子 UI.', ''),
(53, 20, '准备获取这个神器?', '对于这个UI库，这可能是最实惠的价格.', ''),
(54, 21, '基础版本', '个人项目 (只需 $39)', ''),
(55, 22, '开发者版本', '商业项目 (只需 $149)', ''),
(56, 23, '胖子 UI PSD', '设计师', '<li><strong>Photoshop 5.5+</strong> PSD 文件</li>\r\n                            <li><strong>组织图层</strong>和<strong>文件</strong></li>\r\n                            <li>基于<strong>矢量</strong>的图形</li>\r\n                            <li><strong>文档</strong></li>\r\n                            <li><strong>免费的字体库</strong></li>'),
(57, 23, '胖子 UI PSD &amp; HTML', '专业前端工程师', '<li><strong>PSD&amp;HTML</strong>之间的关系</li>\r\n                           <li>使用<strong>kit</strong>让开发更方便 </li>\r\n                           <li>价格<strong>低廉</strong></li>\r\n                           <li><strong>文档</strong></li>\r\n                           <li><strong>免费的字体库</strong></li>'),
(58, 23, '胖子 UI HTML', '程序员', '<li>基于<strong>Bootstrap</strong>的布局</li>\r\n                            <li><strong>冲击视觉的</strong> 图标 &amp; 图形</li>\r\n                            <li><strong>响应式</strong>布局</li>\r\n                            <li><strong>文档</strong></li>\r\n                            <li><strong>免费的字体库</strong></li>'),
(59, 24, '胖子 UI PSD', '设计师', '<li><strong>Photoshop 5.5+</strong> PSD 文件</li>\r\n                            <li><strong>组织图层</strong>和<strong>文件</strong></li>\r\n                            <li>基于<strong>矢量</strong>的图形</li>\r\n                            <li><strong>文档</strong></li>\r\n                            <li><strong>免费的字体库</strong></li>'),
